  nodes(n: Int!): [Node!]!
}

type Node @key(fields: "id") {
  id: Int!
  floats: [Float!]!
  ints: [Int!]!
  strings: [String!]!
  int: Int!
  float: Float!
  string: String!
  nodes(n: Int!): [Node!]!
